package models.pendulum;

public class PendulumModelFactory {
	public static final int DEFAULT_X = 200, DEFAULT_Y = 20, DEFAULT_WIDTH = 0, DEFAULT_HEIGHT = 100,
			DEFAULT_LENGTH = 100, DEFAULT_MASS = 10, DEFAULT_FRICTION = 0, DEFAULT_GRAVITY = 10, DEFAULT_ANGLE = 0, MAX_CAPACITY = 3;

	public synchronized static PendulumModelInterface getDefaultModel() {
